function ButtonCard({ title, icon: Icon }) {
  return (
    <div className="bg-white shadow-lg rounded-md p-6 flex flex-col items-center justify-center transition-colors duration-300 ease-in-out hover:bg-blue-500 hover:text-white">
      <Icon className="text-3xl mb-4" />
      <h3 className="text-xl font-semibold mb-2">{title}</h3>
      <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline">
        Explore
      </button>
    </div>
  );
}
export default ButtonCard;
